column13:
A rotor blade subassembly (250) for an unmanned aerial vehicle (10) that includes a rotor assembly (100) having ducted, coaxial counter-rotating rotors (200, 202), the rotor assembly (100) including a rotor hub (204), comprising:
 flexbeam means (260) configured for reacting centrifugal and bending loads of one of the ducted, coaxial counter-rotating rotors (200 or 202), said flexbeam means (260) having an inboard end (262) and an outboard end (264), said inboard end (262) being configured for securing said flexbeam means (260) in combination with the rotor hub (204); spar means (274) for reacting bending, torsional, shear, and centrifugal loads of the one ducted, coaxial counter-rotating rotor (200 or 202), said spar means (274) functioning as a primary structural member of said rotor blade subassembly (250); torque tube means (272) for reacting torsional and bending loads of the one ducted, coaxial counter-rotating rotor (200 or 202); and a rotor blade (280); said rotor blade (280), said torque tube means (272), said spar means (274), and said flexbeam means (260) being secured in combination at said outboard end (264) of said flexbeam means (260); 
   characterized in that said flexbeam means (260) has a predetermined linear twist along the span thereof from said inboard end (262) to said outboard end (264).
